import Logo from './Logo'
import LoginForm from './LoginForm'

const loginCon = () => {
    return (
        <div className='col-3 loginCon'>

          <Logo classname='loginTitle'/>
          <LoginForm/>
          <Button text='Login' color='orange'/>

        </div>
    )
}

export default loginCon
